// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePageNavbar from './components/HomePageNavbar';  // Import the homepage navbar
import UserNavbar from './components/UserNavbar';  // Import the user navbar
import UserHomePage from './pages/UserHomePage';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import About from './pages/About';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Use HomePageNavbar for Home, Login, Register */}
        <Routes>
          <Route path="/" element={<><HomePageNavbar /><Home /></>} />
          <Route path="/login" element={<><HomePageNavbar /><Login /></>} />
          <Route path="/register" element={<><HomePageNavbar /><Register /></>} />
          
          {/* Use UserNavbar for User Home Page */}
          <Route path="/user-home" element={<><UserNavbar /><UserHomePage /></>} />
        </Routes>

        <footer>
          <p>&copy; 2024 BukSU Lost and Found System</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
